import React from "react";
import Search from "./Search";

function Stock() {
  return (
    <div>
      <Search />
      <buttons>
        <i className="fas fa-sort"></i>
        Sort By
      </buttons>
      <buttons>
        <i className="fas fa-filter"> </i>
        Filter By
      </buttons>
    </div>
  );
}

export default Stock;
